import React from "react";
// @material-ui/core
import Icon from "@material-ui/core/Icon";
// @material-ui/core components
import withStyles from "@material-ui/core/styles/withStyles";
import InputLabel from "@material-ui/core/InputLabel";
// core components
import GridItem from "components/Grid/GridItem.jsx";
import GridContainer from "components/Grid/GridContainer.jsx";
import CustomInput from "components/CustomInput/CustomInput.jsx";
import Button from "components/CustomButtons/Button.jsx";
import Card from "components/Card/Card.jsx";
import CardHeader from "components/Card/CardHeader.jsx";
import CardIcon from "components/Card/CardIcon.jsx";
import CardAvatar from "components/Card/CardAvatar.jsx";
import CardBody from "components/Card/CardBody.jsx";
import CardFooter from "components/Card/CardFooter.jsx";
import Table from "components/Table/Table.jsx";
import ChartistGraph from "react-chartist";

// @material-ui/icons
import Store from "@material-ui/icons/Store";
import Warning from "@material-ui/icons/Warning";
import DateRange from "@material-ui/icons/DateRange";
import LocalOffer from "@material-ui/icons/LocalOffer";
import Update from "@material-ui/icons/Update";
import ArrowUpward from "@material-ui/icons/ArrowUpward";
import AccessTime from "@material-ui/icons/AccessTime";
import Accessibility from "@material-ui/icons/Accessibility";
import BugReport from "@material-ui/icons/BugReport";
import Code from "@material-ui/icons/Code";
import Cloud from "@material-ui/icons/Cloud";
import Sidebar from "components/Sidebar/Sidebar.jsx";
import logo from "assets/img/reactlogo.png";
import routes from "routes.js";

//other new stuff
import {
  dailyEngagementValue,
  monthlyEngagementValue,
  completedTasksChart
} from "variables/charts.jsx";

import avatar from "assets/img/faces/junjia.jpg";

const styles = {
  cardCategoryWhite: {
    color: "rgba(255,255,255,.62)",
    margin: "0",
    fontSize: "16px",
    marginTop: "0",
    marginBottom: "0"
  },
  cardTitleWhite: {
    color: "#FFFFFF",
    marginTop: "0px",
    minHeight: "auto",
    fontWeight: "500",
    fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
    marginBottom: "3px",
    textDecoration: "none"
  }
};

function UserProfile(props) {
  // constructor(props) {
  //   super(props);
  //   this.state = {
  //     image: image,
  //     color: "blue",
  //     hasImage: true,
  //     fixedClasses: "dropdown show",
  //     mobileOpen: false
  //   };
  // }
  const { classes } = props;
  // const { classes, ...rest } = this.props;
  return (
    <div>
      {/* <Sidebar
        routes={routes}
        logoText={"Prof Ong Yew Soon"}
        logo={logo}
        image={this.state.image}
        handleDrawerToggle={this.handleDrawerToggle}
        open={this.state.mobileOpen}
        color={this.state.color}
        {...rest}
      /> */}

      <br />
      <GridContainer>
        <GridItem xs={12} sm={12} md={12}>
          <Card profile>
            <CardAvatar profile>
              <a href="#pablo" onClick={e => e.preventDefault()}>
                <img src={avatar} alt="..." />
              </a>
            </CardAvatar>
            <br />
            <CardHeader color="primary">
              <h2 className={classes.cardTitleWhite}>ER JUN JIA</h2>
              <h4 className={classes.cardCategoryWhite}>
                Personalized Profile Report
              </h4>
            </CardHeader>
            <CardBody profile style={{ marginTop: "0px" }}>
              <h3 className={classes.cardCategory} style={{ marginTop: "5px" }}>
                {" "}
                Character Summary
              </h3>

              <p className={classes.description}>
                Jun Jia is a well-behaved student with good grades. He is rarely
                vocal in class and but he participates the most in Mathematics
                and the least in Chinese. <br />
                Jun Jia interacts mostly within a small social group of Anthony
                Fong and Tan Joo Seng, likely because they are deskmates in the
                same row.
              </p>
              <Button color="primary" round>
                Print
              </Button>
            </CardBody>
          </Card>
        </GridItem>
        <GridItem xs={12} sm={12} md={6}>
          <Card profile>
            <CardHeader color="primary">
              <h3 className={classes.cardTitleWhite}>MATHEMATICS</h3>
              <h6
                className={classes.cardCategoryWhite}
                style={{ fontWeight: "500" }}
              >
                MR. GABRIEL SZE
              </h6>
            </CardHeader>
            <CardBody profile style={{ marginTop: "0px" }}>
              <GridItem xs={12} sm={12} md={12}>
                <Card chart>
                  <CardHeader color="warning">
                    <ChartistGraph
                      className="ct-chart"
                      data={monthlyEngagementValue.data}
                      type="Bar"
                      options={monthlyEngagementValue.options}
                      responsiveOptions={
                        monthlyEngagementValue.responsiveOptions
                      }
                      listener={monthlyEngagementValue.animation}
                    />
                  </CardHeader>
                  <CardBody>
